import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';

const sideNavStyle = {
    height: '100vh',
};

const Home = () => {

    const classes = useStyles();

    return (
        <Grid container spacing={2}>
            {/* Side Navigation */}
            <Grid item xs={2}>
                <Paper className={classes.sideNav}>
                    <Typography variant="h6">Side Navigation</Typography>
                    {/* Add your side navigation content here */}
                </Paper>
            </Grid>

            {/* Header */}
            <Grid item xs={10}>
                <Paper>
                    <Typography variant="h6">Header</Typography>
                    {/* Add your header content here */}
                </Paper>
            </Grid>

            {/* Main Screen */}
            <Grid item xs={12}>
                <Paper>
                    <Typography variant="h6">Main Screen</Typography>
                    {/* Add your main screen content here */}
                </Paper>
            </Grid>
        </Grid>
    );
};

export default Home;
